def get(num):
    ret=0
    while(num!=0):
        ret+=num//5
        num=num//5
    return ret
n=int(input())
for i in range(n):
    num=int(input())
    low=0
    high=10**10
    ans=10000000009
    while(low<=high):
        mid=(low+high)//2
        val=get(mid)
        # print(mid,val)
        if(val>=num):
            high=mid-1
            ans=min(ans,mid)
        else:
            low=mid+1
    print(ans)



